USE [Dashboard];

CREATE TABLE Empresa(
	id_empresa INT IDENTITY,
	emp_nombre VARCHAR (50),
	emp_ciudad VARCHAR (50),
	emp_estado VARCHAR (50),
	emp_zona VARCHAR (25)
);


CREATE TABLE Marca(
	id_marca INT IDENTITY,
	mar_nombre VARCHAR(50)
);

CREATE TABLE Categoria(
	id_categoria INT IDENTITY,
	ctg_nombre VARCHAR(50)
);

CREATE TABLE unidad_medida(
	id_udMedida INT IDENTITY,
	ud_nombre VARCHAR(30)
);

CREATE TABLE Producto(
	id_producto INT IDENTITY,
	prod_nombre VARCHAR(50),
	prod_precio DECIMAL(10,2),
	precio_creado SmallDateTime,
	precio_update SmallDateTime,
	stock VARCHAR(20),
	id_empresa INT,
	id_categoria INT,
	id_udMedida INT
);

CREATE TABLE Venta(
	id_venta INT IDENTITY,
	id_producto INT,
	id_empresa INT,
	id_udMedida INT,
	date_venta SmallDateTime,
	ciudad VARCHAR (50),
	oferta VARCHAR (20),
	prod_nombre VARCHAR(50),
	cant_compra INT,
	prod_precio DECIMAL(10,2),
	ud_nombre VARCHAR(30),
	total DECIMAL(10,2),
	comentario VARCHAR(150)
);
